  return (
    <div className="app m-12 border-2 border-dashed border-green-300 bg-green-100 text-center text-green-700">
      <h1 className="uppercase font-mono text-2xl">Let's become productive !</h1>
      <TodoList />
    </div>
  );
}

export default App;
